css:
atom-text-editor,
:host {
  color: #ff1a56;
  background-color: #2f2f3b;
}
atom-text-editor .wrap-guide,
:host .wrap-guide {
  background-color: #222222;
}
atom-text-editor .indent-guide,
:host .indent-guide {
  color: #373b41;
}
atom-text-editor .invisible-character,
:host .invisible-character {
  color: #373b41;
}
atom-text-editor .gutter,
:host .gutter {
  color: #ff1a56;
  background-color: #282832;
}
atom-text-editor .gutter .line-number.cursor-line,
:host .gutter .line-number.cursor-line {
  color: #f46a7a;
  background-color: #4c4c60;
}
atom-text-editor .gutter .line-number.cursor-line-no-selection,
:host .gutter .line-number.cursor-line-no-selection {
  color: #f46a7a;
}
atom-text-editor .gutter .line-number.folded,
:host .gutter .line-number.folded,
atom-text-editor .gutter .line-number:after,
:host .gutter .line-number:after,
atom-text-editor .fold-marker:after,
:host .fold-marker:after {
  color: #758677;
}
atom-text-editor .invisible,
:host .invisible {
  color: #ff1a56;
}
atom-text-editor .cursor,
:host .cursor {
  width: 2px !important;
  color: #ececec;
  background-color: #ececec;
}
atom-text-editor .selection .region,
:host .selection .region {
  background-color: #004964;
}
atom-text-editor .bracket-matcher .region,
:host .bracket-matcher .region {
  z-index: 100;
  padding: 2px;
  background-color: rgba(255, 255, 255, 0.2);
  border: 1px solid #ff1a56;
}
atom-text-editor .search-results .marker .region,
:host .search-results .marker .region {
  background-color: transparent;
  border: 2px solid #758677;
}
atom-text-editor .search-results .marker.current-result .region,
:host .search-results .marker.current-result .region {
  border: 2px solid #ffffff;
}
.comment {
  color: #758677;
}
.entity.name.type {
  color: #ff1a56;
}
.entity.other.inherited-class {
  color: #b1c3cd;
}
.keyword {
  color: #81adde;
}
.keyword.control {
  color: #81adde;
}
.keyword.operator {
  font-weight: bold;
  color: #ff1a56;
}
.keyword.other.special-method {
  color: #ececec;
}
.keyword.other.unit {
  color: #f46a7a;
}
.storage {
  color: #3fe8d9;
}
.constant {
  color: #f46a7a;
}
.constant.character.escape {
  color: #3fe8d9;
}
.constant.numeric {
  color: #f46a7a;
}
.constant.other.color {
  color: #3fe8d9;
}
.constant.other.symbol {
  color: #f46a7a;
}
.variable {
  font-weight: 500;
  color: #f46a7a;
}
.variable.interpolation {
  color: #f899a4;
}
.variable.parameter.function {
  color: #ff1a56;
}
.variable.other.property.static {
  color: #81adde;
}
.variable.language.this.js {
  font-style: italic;
  font-weight: bold;
  color: #ff1a56;
}
.invalid.illegal {
  color: #2f2f3b;
  background-color: #ff1a56;
}
.string {
  color: #b1c3cd;
}
.string.regexp {
  color: #3fe8d9;
}
.string.regexp .source.ruby.embedded {
  color: #f46a7a;
}
.string.other.link {
  color: #ff1a56;
}
.punctuation.definition.comment {
  color: #758677;
}
.punctuation.definition.string,
.punctuation.definition.variable,
.punctuation.definition.parameters,
.punctuation.definition.array {
  font-weight: bold;
  color: #ff1a56;
}
.punctuation.definition.heading,
.punctuation.definition.identity {
  color: #3fe8d9;
}
.punctuation.definition.bold {
  font-style: bold;
  color: #ff1a56;
}
.punctuation.definition.italic {
  font-style: italic;
  color: #81adde;
}
.punctuation.definition.tag {
  color: #ececec;
}
.punctuation.terminator {
  color: #ececec;
}
.punctuation.section.embedded {
  color: #ececec;
}
.punctuation.section.property-list {
  color: #ececec;
}
.support {
  font-weight: bold;
}
.support.class {
  color: #ff1a56;
}
.support.function {
  color: #ff1a56;
}
.support.type {
  color: #b1c3cd;
}
.entity.name.function {
  color: #ececec;
}
.entity.name.class,
.entity.name.type.class {
  color: #f46a7a;
}
.entity.name.section {
  color: #b1c3cd;
}
.entity.name.tag {
  color: #81adde;
}
.entity.other.attribute-name {
  font-weight: bold;
  color: #ff1a56;
}
.entity.other.attribute-name.id {
  color: #b1c3cd;
}
.none {
  color: #ff1a56;
}
.atom-text-editor[mini] .scroll-view {
  padding-left: 1px;
}
.scroll-view {
  padding-left: 1px;
}
.html.basic {
  color: #ececec;
}
.meta.class {
  color: #ff1a56;
}
.meta.link {
  color: #f46a7a;
}
.meta.require {
  color: #b1c3cd;
}
.meta.selector {
  color: #81adde;
}
.meta.separator {
  color: #ff1a56;
  background-color: #373b41;
}
.meta.brace {
  font-weight: bold;
  color: #ffffff;
}
.meta.property.object.js > .variable.other.property.js {
  color: #f46a7a;
}
.meta.tag.jsx {
  color: #ececec;
}
.dom.js {
  color: #ff1a56;
}
.entity.name.tag.jsx {
  color: #81adde;
}
.period.js {
  color: #ff1a56;
}
.source.js {
  color: #ececec;
}
.string.quoted.js {
  color: #b1c3cd;
}
.markup.bold {
  font-style: bold;
  color: #ff1a56;
}
.markup.changed {
  color: #81adde;
}
.markup.deleted {
  color: #ff1a56;
}
.markup.italic {
  font-style: italic;
  color: #ae62da;
}
.markup.link {
  color: #758677;
}
.markup.heading .punctuation.definition.heading {
  color: #ff1a56;
}
.markup.inserted {
  color: #b1c3cd;
}
.markup.list {
  color: #ff1a56;
}
.markup.quote {
  color: #ececec;
}
.markup.raw.inline {
  color: #b1c3cd;
}
.source.gfm {
  color: #b1c3cd;
}
.heading.gfm {
  color: #ff1a56;
}
.variable.unordered.list.gfm {
  color: #ff1a56;
}
button,
button.icon,
.btn-default,
.btn {
  color: #b1c3cd;
}
